import useCounter from "./hook/useCounter";

function App() {
  const { count, increment, decrement } = useCounter();
  return (
    <div>
      <h1> This is a counter implementing abstraction using a custom hook</h1>
      <button>Increment</button>

      <button>Decrement</button>
      <h2>Decrement: 0</h2>
    </div>
  );
}

export default App;
